import React from "react";

const Form = () => {
  return (
    <div>
      <form>
        <label>
          Adınız:
          <input type="text" name="name" />
        </label>
        <br />
        <label>
          E-posta:
          <input type="email" name="email" />
        </label>
        <br />
        <label>
          Telefon:
          <input type="tel" name="phone" />
        </label>
        <br />
        <button type="submit">Gönder</button>
      </form>
    </div>
  );
};

export default Form;
